import './App.css';
import { useState } from 'react';

const Person = (props)=>{
  return(
  <>
    <h1>Name : {props.name}</h1> 
    <h2>Last Name : {props.lName}</h2>  
    <h2>Age : {props.age}</h2>
  </>
  )
}


const App = ()=> {
  const [counter, setCounter] = useState(0)
  return (

    <div className="App">
      <button onClick={()=>setCounter((prev)=>prev-1)}>-</button>
      <h1 id='value'>0</h1>
      <button >+</button>

    </div>
  );
}

export default App;
